import React from 'react';
import './contact.css';
import Button from "react-bootstrap/Button";

function Contact() {

  return (
      <div className={'contact'}>
          <h1>Contact Us</h1>
          <p>MAES welcomes any opportunity that can help further the careers of our engineers. If you are a company/organization that has infromation our members can benefit from please feel free to reach out! </p>
          <p></p>
          <div>
              <Button variant="success" href = {"mailto: maes-request@mit.edu"}>Email Us!</Button>{'  '}
              <Button variant="primary" href = {"mailto: maes-request@mit.edu"}>Email Us!</Button>
          </div>
      </div>
  );
}

export default Contact;
